import React from "react";
import axios from "axios"; 
import "./index.css";

import { Component } from "react";

const Modal = ({smsList,handleSubmit}) => {

  const handleFormSubmission = (event) =>{
    handleSubmit();
  }




  return (
    <div className="modal-outer-container">
      <div className="modal-container">
        <form className="sms-form" onSubmit={handleFormSubmission}>
          <input
            type="text"
            placeholder="Student name"
            className="studentName input"
            required
          />

          <input
            type="text"
            placeholder="Student Address"
            className="studentAddress input"
            required
          />

          <input
            type="email"
            placeholder="Student Email"
            className="studentEmail input"
            required
          />

          <button type="submit" className="btn-studentSubmit">
            submit
          </button>
        </form>
      </div>
    </div>
  );
};

export default Modal;
